    private static ToIntFunction<BlockState> litBlockEmission(int n) {
        return blockState -> blockState.getValue(BlockStateProperties.LIT) != false ? n : 0;
    }

    private static Boolean never(BlockState blockState, BlockGetter blockGetter, BlockPos blockPos, EntityType<?> entityType) {
        return false;
    }

    private static Boolean always(BlockState blockState, BlockGetter blockGetter, BlockPos blockPos, EntityType<?> entityType) {
        return true;
    }

    private static Boolean ocelotOrParrot(BlockState blockState, BlockGetter blockGetter, BlockPos blockPos, EntityType<?> entityType) {
        return entityType == EntityType.OCELOT || entityType == EntityType.PARROT;
    }

    private static BedBlock bed(DyeColor dyeColor) {
        return new BedBlock(dyeColor, BlockBehaviour.Properties.of(Material.WOOL, blockState -> blockState.getValue(BedBlock.PART) == BedPart.FOOT ? dyeColor.getMaterialColor() : MaterialColor.WOOL).sound(SoundType.WOOD).strength(0.2f).noOcclusion());
    }

    private static RotatedPillarBlock log(MaterialColor materialColor, MaterialColor materialColor2) {
        return new RotatedPillarBlock(BlockBehaviour.Properties.of(Material.WOOD, blockState -> blockState.getValue(RotatedPillarBlock.AXIS) == Direction.Axis.Y ? materialColor : materialColor2).strength(2.0f).sound(SoundType.WOOD));
    }

    private static Block netherStem(MaterialColor materialColor) {
        return new RotatedPillarBlock(BlockBehaviour.Properties.of(Material.NETHER_WOOD, blockState -> materialColor).strength(2.0f).sound(SoundType.STEM));
    }

    private static boolean always(BlockState blockState, BlockGetter blockGetter, BlockPos blockPos) {
        return true;
    }

    private static boolean never(BlockState blockState, BlockGetter blockGetter, BlockPos blockPos) {
        return false;
    }

    private static StainedGlassBlock stainedGlass(DyeColor dyeColor) {
        return new StainedGlassBlock(dyeColor, BlockBehaviour.Properties.of(Material.GLASS, dyeColor).strength(0.3f).sound(SoundType.GLASS).noOcclusion().isValidSpawn((arg_0, arg_1, arg_2, arg_3) -> Blocks.never(arg_0, arg_1, arg_2, arg_3)).isRedstoneConductor((arg_0, arg_1, arg_2) -> Blocks.never(arg_0, arg_1, arg_2)).isSuffocating((arg_0, arg_1, arg_2) -> Blocks.never(arg_0, arg_1, arg_2)).isViewBlocking((arg_0, arg_1, arg_2) -> Blocks.never(arg_0, arg_1, arg_2)));
    }

    private static LeavesBlock leaves() {
        return new LeavesBlock(BlockBehaviour.Properties.of(Material.LEAVES).strength(0.2f).randomTicks().sound(SoundType.GRASS).noOcclusion().isValidSpawn((arg_0, arg_1, arg_2, arg_3) -> Blocks.ocelotOrParrot(arg_0, arg_1, arg_2, arg_3)).isSuffocating((arg_0, arg_1, arg_2) -> Blocks.never(arg_0, arg_1, arg_2)).isViewBlocking((arg_0, arg_1, arg_2) -> Blocks.never(arg_0, arg_1, arg_2)));
    }

    private static ShulkerBoxBlock shulkerBox(DyeColor dyeColor, BlockBehaviour.Properties properties) {
        BlockBehaviour.StatePredicate statePredicate = (blockState, blockGetter, blockPos) -> {
            BlockEntity blockEntity = blockGetter.getBlockEntity(blockPos);
            if (!(blockEntity instanceof ShulkerBoxBlockEntity)) {
                return true;
            }
            ShulkerBoxBlockEntity shulkerBoxBlockEntity = (ShulkerBoxBlockEntity)blockEntity;
            return shulkerBoxBlockEntity.isClosed();
        };
        return new ShulkerBoxBlock(dyeColor, properties.strength(2.0f).dynamicShape().noOcclusion().isSuffocating(statePredicate).isViewBlocking(statePredicate));
    }

    private static PistonBaseBlock pistonBase(boolean bl) {
        BlockBehaviour.StatePredicate statePredicate = (blockState, blockGetter, blockPos) -> blockState.getValue(PistonBaseBlock.EXTENDED) == false;
        return new PistonBaseBlock(bl, BlockBehaviour.Properties.of(Material.PISTON).strength(1.5f).isRedstoneConductor((arg_0, arg_1, arg_2) -> Blocks.never(arg_0, arg_1, arg_2)).isSuffocating(statePredicate).isViewBlocking(statePredicate));
    }

    private static Block register(String string, Block block) {
        return Registry.register(Registry.BLOCK, string, block);
    }

    public static void rebuildCache() {
        Block.BLOCK_STATE_REGISTRY.forEach(BlockBehaviour.BlockStateBase::initCache);
    }

    static {
        for (Block block : Registry.BLOCK) {
            for (BlockState blockState2 : block.getStateDefinition().getPossibleStates()) {
                Block.BLOCK_STATE_REGISTRY.add(blockState2);
            }
            block.getLootTable();
        }
    }
